import React from 'react'

const Lists = ({movieList,setMovieList}) => {
  return (
    <div>

        {movieList.map((movie) => (
            <div key={movie.id}>
                <img src={`${movie.posterPath}`}/>
                {movie.id}
                {movie.title}
                {movie.average}
            </div>

          ))}

      </div>
  )
}
